import React, { Component } from 'react';
import './App.css';
import Tabs from './Tabs';
import AppNavBar from './AppNavBar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PendingWFList from './PendingWFList';
import ClosedWFList from "./WorkflowList";
import ReviewWFList from "./ReviewWFList";
import WorkflowClose from './WorkflowClose';
import WorkflowEdit from './WorkflowEdit'
import { Button, ButtonGroup, Container, Table } from 'reactstrap';
import { Link, withRouter } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends Component {
  render() {
    return (
      <div>
        <Router>
        <AppNavBar />
        <br/>
        <div className="float-right">
                        <Button color="success" tag={Link} to="/workflow/new" style={{float:"right", marginRight: "30px"}}>New Workflow</Button>
        </div>
          <Switch>
            <div>
              <br/>
              <Tabs>
                <div label="Pending">
                  <Route path='/Workflow' exact={true} component={PendingWFList} />
                </div>
                <div label="Review">
                  <Route path='/Workflow' exact={true} component={ReviewWFList} />
                </div>
                <div label="Closed">
                  <Route path='/Workflow' exact={true} component={ClosedWFList} />
                </div>
              </Tabs>
            </div>
            <Route path='/Workflow/close/:id' component={WorkflowClose} />
            <Route path='/Workflow/:id' component={WorkflowEdit} />
          </Switch>
        </Router>
      </div>
    )
  }
}

export default App;
